var wOpenDialog = angular.module( "wOpenDialog2",[]);
console.log("after wOpenDialog module");

wOpenDialog.controller( "wOpenDialog2Controller", function( $scope, $compile ) {
    console.log("within wOpenDialogController");
    //var dialogCallback = function(event, btn) {
    var dialogCallback = function(btn) {
        //console.log(event.data);
        console.log(btn);
    };

	$scope.openHtmlDialog = function(arg) {
	    dfxOpenDialog({
	        'top': '25%',
	        'left': '25%',
	        'width': '400px',
	        'height': '200px',
	        'html': '<b>Open dialog HTML content</b>',
	        'buttons': 'OK_CANCEL'
	    });
	};
	$scope.openFormWidgetDialog = function(arg) {
	    dfxOpenDialog({
	        'title': 'My Dialog Form',
	        'top': '25%',
	        'left': '25%',
	        'width': '600px',
	        'height': '300px',
	        'widgetName': 'wForm',
	        'buttons': 'YES_NO_CANCEL',
	        'callback': dialogCallback
	    }, $scope, $compile);
	};
	$scope.openChartWidgetDialog = function(arg) {
	    dfxOpenDialog({
	        'top': '25%',
	        'left': '25%',
	        'width': '600px',
	        'height': '300px',
	        'widgetName':'wChart'
	    }, $scope, $compile);
	};
});
